import React, {Fragment} from "react";

const FileUpload = () => {
    return (
        <Fragment>
           <form>
           <div class="custom-file">
            <input type="file" class="custom-file-input" id="customFile"/>
            <label class="custom-file-label" for="customFile">Choose file</label>
            </div>
            </form> 
        </Fragment>
    )
}

export default FileUpload;
